import React from "react";
import endFooter from "../../data/footer.json";
import "./endFooter.css";

const EndFooter = () => {
  return (
    <ul>
      {endFooter.map((item) => (
        <li>
          <a href="">{item.col_values}</a>
        </li>
      ))}
    </ul>
  );
};
export default EndFooter;
